import React from "react";
import axios from "axios";
axios
  .get("https://picsum.photos/v2/list")
  .then(function (response) {
    return response.data();
  })
  .catch(function (error) {
    console.log(error);
  });
const Photos = () => {
  return;
  <div></div>;
};

export default Photos;
